css:
.fb-on-demand-entries-container {
  padding-top: 20px;
}
.fb-on-demand-tabs .nuclide-tabs .tab-bar {
  background-color: #21252b;
  background-image: none;
}
.fb-on-demand-status-list {
  display: flex;
  flex-flow: column nowrap;
}
.fb-on-demand-status-list .fb-on-demand-status-list-header {
  flex: 1;
  line-height: 1.5em;
}
.fb-on-demand-status-list .fb-on-demand-status-list-header span {
  margin-left: 10px;
  position: relative;
}
.fb-on-demand-status-list .fb-on-demand-status-list-selected {
  border: 1px solid #d7dae0;
  border-radius: 3px;
}
.fb-on-demand-entry-container {
  flex: 2;
  display: flex;
  flex-flow: column;
  background-color: #2c313a;
  border-bottom: 1px solid #181a1f;
  border-right: 1px solid #181a1f;
}
.fb-on-demand-entry-container:first-of-type {
  border-top: 1px solid #181a1f;
}
.fb-on-demand-entry-container-selected {
  background-color: #373d48;
}
.fb-on-demand-entry {
  flex: 1;
  display: flex;
  padding: 10px;
  overflow: hidden;
  border-left: 3px solid rgba(66, 134, 244, 0.25);
}
.fb-on-demand-entry.abandoned {
  border-left: 3px solid rgba(0, 0, 0, 0.5);
}
.fb-on-demand-entry.accepted {
  border-left: 3px solid rgba(63, 191, 63, 0.7);
}
.fb-on-demand-entry.changes-planned {
  border-left: 3px solid #fa3e3e;
}
.fb-on-demand-entry.closed {
  border-left: 3px solid #90949c;
}
.fb-on-demand-entry.in-preparation {
  border-left: 3px solid #90949c;
}
.fb-on-demand-entry.reverted {
  border-left: 3px solid #90949c;
}
.fb-on-demand-entry.needs-review {
  border-left: 3px solid rgba(238, 179, 52, 0.7);
}
.fb-on-demand-entry.needs-revision {
  border-left: 3px solid rgba(238, 86, 52, 0.7);
}
.fb-on-demand-entry-left {
  flex: 3;
  display: flex;
  flex-flow: column;
}
.fb-on-demand-entry-left .fb-on-demand-entry-header {
  flex: 3;
  padding-bottom: 5px;
  font-weight: bold;
}
.fb-on-demand-entry-toggle {
  color: #9da5b4;
  line-height: 1.5em;
  font-size: 12px;
  cursor: pointer;
  transition: opacity 0.1s ease-in-out;
}
.fb-on-demand-entry-toggle:hover {
  color: white;
  opacity: 1;
}
.fb-on-demand-entry-info {
  flex: 1;
  font-size: 10.8px;
  padding: 2px 0 0 0;
  margin: 0;
}
.fb-on-demand-entry-info li {
  display: inline-block;
}
.fb-on-demand-entry-info li:after {
  content: "\2022";
  padding: 5px;
}
.fb-on-demand-entry-info li:last-child:after {
  content: none;
  padding: inherit;
}
.fb-on-demand-entry-info li .hidden {
  display: none;
}
.fb-on-demand-entry-right {
  flex: 1;
  display: flex;
  flex-flow: column;
}
.fb-on-demand-entry-status {
  flex: 1;
  font-size: 10.8px;
  text-align: right;
  line-height: 1.5em;
}
.fb-on-demand-entry-button {
  flex: 1;
  text-align: right;
}
.fb-on-demand-entry-button .btn {
  border: 1px solid #181a1f;
  background-color: #353b45;
  box-shadow: none;
}
.fb-on-demand-entry-details {
  flex: 1;
  color: #9da5b4;
  cursor: default;
  overflow: auto;
  padding: 10px;
  white-space: normal;
  width: 100%;
  -webkit-user-select: initial;
}
.fb-on-demand-entry-details > pre {
  padding: 0;
}
.fb-on-demand-entry-details h2 {
  color: #d7dae0;
  margin-bottom: 10px;
  margin-top: 0;
  line-height: 1.5;
}
.fb-on-demand-entry-details .nuclide-ui-fb-avatar-image {
  padding: 5px;
  background-image: linear-gradient(45deg, #21252b, #3a3f4b);
}
.fb-on-demand-details-item-inline {
  display: inline-flex;
  flex-flow: column;
  padding: 10px 20px 10px 0;
}
.fb-on-demand-details-item-link {
  flex: 1;
  margin-bottom: 5px;
}
a.fb-on-demand-details-item-link:hover {
  text-decoration: none;
}
.fb-on-demand-details-item-link:hover .fb-on-demand-details-item-link-label {
  text-decoration: underline;
}
.fb-on-demand-details-item-label {
  flex: 1;
  margin-bottom: 5px;
}
.fb-on-demand-changed-files-loading {
  padding-top: 10px;
  padding-bottom: 10px;
}
.fb-on-demand-changed-files-title {
  font-size: 12px;
}
.fb-on-demand-details-item-markdown {
  background-color: #1b1d23;
  border-radius: 3px;
  border: 1px solid #181a1f;
  margin: 10px 0;
  padding: 5px 10px;
}
.fb-on-demand-details-item-markdown p:last-child {
  margin-bottom: 0;
}
.fb-on-demand-details-item-markdown img {
  max-width: 40em;
}
